import React, { Component } from 'react'
import { Link, withRouter } from 'react-router-dom'
import cx from 'classnames'
import './index.scss'
// import { pageRequest } from '../../store/actions/Page'
import { toggleNavbar, getActiveRoute } from './utils'

class Sidebar extends Component {
    state = {
        id: '1',
        isSocialMediaOpen: false,
        isMouseOn: false,
        isWebsitMonitoringOpen: false,
    }
    selectSidebar = id => {
        console.log('jghghghghghghghhgghg', id)
        // pageRequest(id)
    }

    toggleSocialMediaMenu = isSocialMediaOpen => this.setState({ isSocialMediaOpen })
    onMouseEnter = () => {
        toggleNavbar()
        this.setState({
            isMouseOn: true,
        })
    }
    toggleWebsiteTrackingMenu = isWebsitMonitoringOpen => this.setState({ isWebsitMonitoringOpen })
    onMouseEnter = () => {
        toggleNavbar()
        this.setState({
            isMouseOn: true,
        })
    }

    onMouseLeave = () => {
        toggleNavbar()
        this.setState({
            isMouseOn: false,
            isSocialMediaOpen: false,
            isWebsitMonitoringOpen: false,
        })
    }

    render() {
        const { match } = this.props
        const { isSocialMediaOpen, isWebsitMonitoringOpen } = this.state
        return (
            <nav
                className="sidebar"
                onMouseEnter={this.onMouseEnter}
                onMouseLeave={this.onMouseLeave}
            >
                <div className="sidebar-content">
                    <div className="logo">
                        <img src="https://image.ibb.co/eRp7qV/tuple-logo.png" alt="" />
                    </div>

                    <ul className="sidebar-nav">
                        <li
                            className={cx({
                                active: getActiveRoute('/social-media/twitter', match.path),
                            })}
                        >
                            <Link onClick={() => this.selectSidebar(1)} to="/social-media/twitter">
                                <span className="icon">
                                    <i className="fi flaticon-home" />
                                </span>
                                Dashboard
                            </Link>
                        </li>
                        <li
                            className={cx({
                                active: getActiveRoute('/social-media/facebook', match.path),
                            })}
                        >
                            <a
                                onClick={() => {
                                    this.selectSidebar(2)
                                    this.toggleSocialMediaMenu(!isSocialMediaOpen)
                                }}
                            >
                                <span className="icon">
                                    <i className="fi flaticon-users" />
                                </span>
                                Social Media
                            </a>
                            <ul
                                id="sidebar-ui"
                                className={cx('collapse', { show: isSocialMediaOpen })}
                            >
                                {/* <li className="">
                                    <Link to="/social-media/facebook">Facebook</Link>
                                </li> */}
                                <li className="">
                                    <Link to="/social-media/twitter">Twitter</Link>
                                </li>
                                <li className="">
                                    <Link to="/social-media/news">News</Link>
                                </li>
                            </ul>
                        </li>
                        <li
                            className={cx({
                                active: getActiveRoute('/time-intelligence', match.path),
                            })}
                        >
                            <a
                                onClick={() => {
                                    this.selectSidebar(2)
                                    this.toggleWebsiteTrackingMenu(!isWebsitMonitoringOpen)
                                }}
                            >
                                <span className="icon">
                                    <i className="fi flaticon-internet" />
                                </span>
                                Website Visitor Tracking
                            </a>
                            <ul
                                id="sidebar-ui"
                                className={cx('collapse', { show: isWebsitMonitoringOpen })}
                            >
                                <li className="">
                                    <Link to="/time-intelligence">Time Intelligence</Link>
                                </li>
                                <li className="">
                                    <Link to="/demographics">Demographics</Link>
                                </li>
                                {/* <li className="">
                                    <Link to="/analytics">Analytics</Link>
                                </li> */}
                            </ul>
                        </li>
                        <li
                            className={cx({
                                active: getActiveRoute('/components', match.path),
                            })}
                        >
                            <Link onClick={() => this.selectSidebar(1)} to="/components">
                                <span className="icon">
                                    <i className="glyphicon glyphicon-list-alt" />
                                </span>
                                Components
                            </Link>
                        </li>
                    </ul>
                </div>
            </nav>
        )
    }
}

export default withRouter(Sidebar)
